import React from "react";
import { Routes ,Route,useParams } from "react-router-dom";
import NavBar from './NavBar'
import About from './About'
const ParamHooks = (()=>{
    return (
        <>
        <NavBar/>
            this is param hooks 
            <Routes>
            <Route exact path="/contact/about" element = {<About name = "About"/>}/>
            <Route exact path="/contact" element = {<About name = "Contact"/>}/>
            <Route path='/*' element = {<About name = "Service"/>}/>
            <Route exact path="/user/:name" element = {<About name = "piyush"/>}/>
        </Routes>
        </>
    )
})
export default ParamHooks
